(2542, 1, '2024-05-08 15:30:18', '0000-00-00 00:00:00', 'McMafia nous plonge dans le monde complexe du crime organisé. Elle suit une famille russe vivant en exil à Londres et met au jour un obscur réseau de blanchisseurs de capitaux à Dubaï, de cybercriminels en Inde, d\'acteurs du marché noir à Zagreb, de narcotrafiquants colombiens ou d\'oligarques russes à Londres.', 'mcmafia', '', 'draft', 'closed', 'closed', '', '', '', '', '2024-05-08 15:30:18', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress/?post_type=products&p=2542', 0, 'products', '', 0),
