(2544, 1, '2024-05-08 15:30:18', '0000-00-00 00:00:00', 'De jeunes recrues du FBI se battent de toutes leurs forces sur le camp d\'entraînement de Quantico en Virginie, entre tests d\'endurance physique, cours de tir et maîtrise de l\'art de l\'enquête et de l\'interrogatoire. Ils ont 50% de chances d\'échouer, la compétition fait rage. 9 mois plus tard, l\'un d\'entre eux est suspecté d\'avoir commis la pus grosse attaque terroriste sur le sol Américain depuis le 11 Septembre 2001...', 'quantico', '', 'draft', 'closed', 'closed', '', '', '', '', '2024-05-08 15:30:18', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress/?post_type=products&p=2544', 0, 'products', '', 0),
