(2545, 1, '2024-05-08 15:30:18', '0000-00-00 00:00:00', 'Only Murders In The Building suit trois inconnus qui partagent une passion pour les faits divers et qui se retrouvent soudain mêlés à l\'une de ces aventures, alors qu\'ils enquêtent sur la mort mystérieuse d\'un voisin dans leur immeuble de New York.', 'only murders in the building', '', 'draft', 'closed', 'closed', '', '', '', '', '2024-05-08 15:30:18', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress/?post_type=products&p=2545', 0, 'products', '', 0),
(2538, 1, '2024-05-08 15:30:17', '0000-00-00 00:00:00', 'Christopher Chance est un mystérieux garde du corps qui travaille à son compte et qui prend différentes identités afin de protéger ses clients en danger de mort.', 'human target : la cible', '', 'draft', 'closed', 'closed', '', '', '', '', '2024-05-08 15:30:17', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress/?post_type=products&p=2538', 0, 'products', '', 0),
(2536, 1, '2024-05-08 15:30:17', '0000-00-00 00:00:00', 'Des années après une retraite bien méritée d\'une formidable vie de ninjas, une famille dysfonctionnelle doit reprendre du service pour faire face à une série de menaces.', 'house of ninjas', '', 'draft', 'closed', 'closed', '', '', '', '', '2024-05-08 15:30:17', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress/?post_type=products&p=2536', 0, 'products', '', 0),
(2535, 1, '2024-05-08 15:30:17', '0000-00-00 00:00:00', 'Henry est un enfant de 13 ans pas comme les autres. Il est Kid Danger et aide son acolyte, Captain Man, à sauver le monde. Il doit tout faire pour que ses amis ne découvrent pas son secret.', 'henry danger', '', 'draft', 'closed', 'closed', '', '', '', '', '2024-05-08 15:30:17', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress/?post_type=products&p=2535', 0, 'products', '', 0),
