(2546, 1, '2024-05-08 15:30:18', '0000-00-00 00:00:00', 'Engagée dans un long périple au volant de sa Plymouth Barracuda, Charlie Cale rencontre de nouvelles personnes à chaque arrêt et ne peut s’empêcher de résoudre des crimes grâce à une extraordinaire capacité à repérer lorsque quelqu’un ment.', 'poker face', '', 'draft', 'closed', 'closed', '', '', '', '', '2024-05-08 15:30:18', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress/?post_type=products&p=2546', 0, 'products', '', 0),
(2537, 1, '2024-05-08 15:30:17', '0000-00-00 00:00:00', 'Le public suivra le groupe de dix comédiens, chacun étant bien décidé à être le dernier à craquer. Six heures durant, une seule règle comptera : qui rit perd la partie. Celui qui parviendra à rester de marbre jusqu’au bout remportera le jeu et pourra reverser ses 50 000€ de dotation à l’association caritative de son choix.', 'lol : qui rit, sort !', '', 'draft', 'closed', 'closed', '', '', '', '', '2024-05-08 15:30:17', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress/?post_type=products&p=2537', 0, 'products', '', 0),
