(2540, 1, '2024-05-08 15:30:18', '0000-00-00 00:00:00', 'Lupin III n\'est autre que l\'arrière petit-fils du célèbre Arsène Lupin. De son aïeul, il a hérité l\'art du cambriolage tout en intelligence et en finesse, mais également l\'art de plaire et de charmer. Lupin fait donc le tour du monde pour récupérer les plus grands trésors et autres objets de valeur, accompagné en général de ses acolytes : Jigen, l\'expert du revolver, Goemon, le samouraï de la bande, et Fujiko, la femme fatale dont l\'imprévisibilité n\'a d\'égal que sa beauté. Malheureusement pour notre héros, un inspecteur particulièrement coriace est systématiquement à ses trousses : Zenigata est en effet certainement le policier qui connaît le mieux tous ses faits et gestes. Aussi lorsque ces deux-là se rencontrent, ça signifie qu\'il va y avoir du sport !', 'lupin iii', '', 'draft', 'closed', 'closed', '', '', '', '', '2024-05-08 15:30:18', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress/?post_type=products&p=2540', 0, 'products', '', 0),
