(2534, 1, '2024-05-08 15:30:17', '0000-00-00 00:00:00', 'La série se déroule de nos jours à Chicago, aux États-Unis et suit les membres d\'une caserne des sapeurs-pompiers de la ville : la caserne 51. Elle se concentre aussi bien sur l\'aspect professionnel du métier que sur la vie sociale des différents personnages. La vie au sein de la caserne, les émotions des personnages ainsi que les différents problèmes qu\'ils rencontrent sont au centre de l\'histoire, le tout agrémenté de nombreuses interventions qui donnent la part d\'action à l\'histoire.', 'chicago fire', '', 'draft', 'closed', 'closed', '', '', '', '', '2024-05-08 15:30:17', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress/?post_type=products&p=2534', 0, 'products', '', 0),
(2530, 1, '2024-05-08 15:30:16', '0000-00-00 00:00:00', 'Trente ans après le tournoi qui a changé leur vie, Johnny et Daniel voient leur rivalité ravivée dans cette suite de la saga Karaté Kid.', 'cobra kai', '', 'draft', 'closed', 'closed', '', '', '', '', '2024-05-08 15:30:16', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress/?post_type=products&p=2530', 0, 'products', '', 0),
(2531, 1, '2024-05-08 15:30:16', '0000-00-00 00:00:00', 'À 17 ans, Rue Bennett, fraîchement sortie de désintox, cherche à donner un sens à son existence. Elle se lie très vite à Jules Vaughn, une fille trans récemment arrivée en ville après le divorce de ses parents. Dans leur sillage gravitent Nate Jacobs, un sportif dont les problèmes de colère masquent des complexes sexuels ; Maddy Perez, la petite amie de Nate ; Chris McKay, star de l\'équipe de football qui peine à suivre les cours ; Cassie Howard, dont le passif sexuel continue de la poursuivre ; Lexi Howard, jeune sœur de Cassie et amie d\'enfance de Rue ; et Kat Hernandez, en pleine exploration de sa sexualité.\n\nAdaptation US de la série éponyme israëlienne Euphoria (2012), elle-même tirée d\'une histoire vraie.', 'euphoria', '', 'draft', 'closed', 'closed', '', '', '', '', '2024-05-08 15:30:16', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress/?post_type=products&p=2531', 0, 'products', '', 0),
