(2550, 1, '2024-05-08 15:30:19', '0000-00-00 00:00:00', 'Dans le Montana, la famille Dutton possède le plus grand ranch des États-Unis près du parc national de Yellowstone. Menée par le patriarche John, la famille se bat contre des politiciens et des promoteurs immobiliers.', 'yellowstone', '', 'draft', 'closed', 'closed', '', '', '', '', '2024-05-08 15:30:19', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress/?post_type=products&p=2550', 0, 'products', '', 0),
(2551, 1, '2024-05-08 15:30:19', '0000-00-00 00:00:00', 'Quand un jeune garçon disparaît, une petite ville découvre une affaire mystérieuse, des expériences secrètes, des forces surnaturelles terrifiantes... et une fillette.', 'stranger things', '', 'draft', 'closed', 'closed', '', '', '', '', '2024-05-08 15:30:19', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress/?post_type=products&p=2551', 0, 'products', '', 0),
(2552, 1, '2024-05-08 15:30:19', '0000-00-00 00:00:00', 'Au Texas, un état où le football et la religion règnent, il n\'est pas facile d\'être un esprit scientifique hors du commun. Cette série raconte la jeunesse de Sheldon Cooper, personnage atypique et excentrique de la série THE BIG BANG THEORY. Alors que le jeune garçon cherche comment évoluer au sein de sa très normale famille, cette dernière doit aussi trouver un moyen de comprendre cet être à la fois malaisant et attachant. Avec Jim Parsons et Iain Armitage.', 'young sheldon', '', 'draft', 'closed', 'closed', '', '', '', '', '2024-05-08 15:30:19', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress/?post_type=products&p=2552', 0, 'products', '', 0),
